import React, { Component } from 'react';
import { View,Text, Image, TouchableOpacity, ListView } from 'react-native';
import ResponsiveImage from 'react-native-responsive-image';
import Share, {ShareSheet, Button} from 'react-native-share';

const imagesList = {
  image1: require('../assets/images/speechbubbles/Cheers.png'),
  image2: require('../assets/images/speechbubbles/DatD.png'),
  image3: require('../assets/images/speechbubbles/HeCould.png'),
  image4: require('../assets/images/speechbubbles/LastFling.png'),
  image5: require('../assets/images/speechbubbles/Redick.png'),
  image6: require('../assets/images/speechbubbles/TalkDirty.png'),
  image7: require('../assets/images/speechbubbles/TooLit.gif'),
  image8: require('../assets/images/speechbubbles/TruthDare.gif')
};

const listofImages = ['image1', 'image2']

const REACT_ICON = 'data:image/gif;base64,'

let shareImageBase64 = {
  title: "React Native",
  message: "",
  url: REACT_ICON,
  subject: "Share Link" //  for email
};

class SpeechBubbles extends Component {

  constructor(props) {
    super(props);
    const dataSource = new ListView.DataSource({ rowHasChanged: (r1, r2) => r1.guid !== r2.guid });
    this.state = {
      dataSource: dataSource.cloneWithRows(listofImages),
    };
  }


  shareImage(rowData) {
    Share.open(shareImageBase64);
  }

  renderRow(rowData) {
    return (
      <TouchableOpacity onPress={()=>{
        Share.open(shareImageBase64);
      }}>
        <View style={styles.instructions}>
          <Text>Simple Share Image Base 64</Text>
        </View>
      </TouchableOpacity>
    );
  }

  render() {
    return (
       <View style={styles.container}>
          <View>
             <ListView
                contentContainerStyle={styles.list}
                dataSource={this.state.dataSource}
                renderRow={this.renderRow.bind(this)}
             />
          </View>
       </View>
    );
  }
}

const styles = {
    container: {
      flex: 1,
      alignItems: 'center'
    },
    list: {
        justifyContent: 'center',
        flexDirection: 'row',
        flexWrap: 'wrap',
        alignItems: 'center'
    },
    item: {
        margin: 3,
        width: 100,
        height: 100
    }
};

export { SpeechBubbles };
